import React, { useEffect, useState } from "react";
import { useParams, useNavigate } from "react-router-dom";

const ViewTenant = () => {
  const { tenant_id } = useParams();
  const navigate = useNavigate();
  const [tenant, setTenant] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchTenant = async () => {
      try {
        const res = await fetch(
          `http://localhost:5000/view_tenant/${tenant_id}`,
          { credentials: "include" }
        );
        const data = await res.json();
        if (res.ok && data.success) setTenant(data.tenant);
        else alert(data.message || "Tenant not found");
      } catch (err) {
        console.error(err);
        alert("Error fetching tenant");
      } finally {
        setLoading(false);
      }
    };
    fetchTenant();
  }, [tenant_id]);

  if (loading) return <p>Loading tenant details...</p>;
  if (!tenant) return <p>Tenant not found</p>;

  return (
    <div style={{ fontFamily: "Arial, sans-serif", padding: 20 }}>
      <h2 style={{ textAlign: "center", background: "#273c75", color: "white", padding: 15, borderRadius: 6 }}>
        Tenant Details
      </h2>

      <button
        onClick={() => navigate(-1)}
        style={{
          marginTop: 20,
          backgroundColor: "#7f8c8d",
          color: "#fff",
          padding: "8px 12px",
          border: "none",
          borderRadius: 6,
          cursor: "pointer",
        }}
      >
        ← Back
      </button>

      <div style={{ display: "flex", gap: 30, marginTop: 20 }}>
        {/* Tenant Photo */}
        {tenant.tenantphoto ? (
          <img
            src={`data:image/jpeg;base64,${tenant.tenantphoto}`}
            alt="Tenant"
            style={{ width: "200px", height: "200px", objectFit: "cover", borderRadius: "10px" }}
          />
        ) : (
          <p>No tenant photo available</p>
        )}

        {/* Tenant Info */}
        <div style={{ flex: 1 }}>
          <p><strong>Name:</strong> {tenant.tenantname}</p>
          <p><strong>DOB:</strong> {tenant.tendantob?.slice(0, 10)}</p>
          <p><strong>Nationality:</strong> {tenant.tenantnationality}</p>
          <p><strong>Email:</strong> {tenant.tenantemailid}</p>
          <p><strong>Mobile:</strong> {tenant.tenantmobilenumber}</p>
          <p><strong>Employer:</strong> {tenant.tenantemployer}</p>
          <p><strong>Lease:</strong> {tenant.leasestartdate?.slice(0, 10)} → {tenant.leaseenddate?.slice(0, 10)}</p>
          <p><strong>Rent:</strong> {tenant.rentamount}</p>
          <p><strong>Deposit:</strong> {tenant.depositamountreceived}</p>
        </div>
      </div>

      {/* Documents as Images */}
      <div style={{ marginTop: 30 }}>
        <h3 style={{ color: "#27ae60" }}>Documents</h3>
        <div style={{ display: "flex", gap: 20, flexWrap: "wrap" }}>
          {tenant.passportcopypath && (
            <img
              src={`data:image/jpeg;base64,${tenant.passportcopypath}`}
              alt="Passport Copy"
              style={{ width: 250, height: 150, objectFit: "cover", borderRadius: 6 }}
            />
          )}
          {tenant.eidcopypath && (
            <img
              src={`data:image/jpeg;base64,${tenant.eidcopypath}`}
              alt="EID Copy"
              style={{ width: 250, height: 150, objectFit: "cover", borderRadius: 6 }}
            />
          )}
        </div>
      </div>
    </div>
  );
};

export default ViewTenant;
